import styles from "./styles.module.css";

const Main = () => {
	const handleLogout = () => {
		localStorage.removeItem("token");
		window.location.reload();
	};

	return (


				<button className={styles.white_btn} onClick={handleLogout}>
					Logout
				</button>

	);
};

export default Main;
